import React, { useEffect } from 'react';
import SearchCompanies from '../Components/SearchCompanies';

function SearchCompaniesPage() {

    const fetchCompanyJobs = async ()=>{
        const url = 'https://indeed12.p.rapidapi.com/company/Ubisoft/jobs?locality=us&start=1';
        const options = {
            method: 'GET',
            headers: {
                'x-rapidapi-key': 'f8e6470882msh4963a2e6b93a4a4p123da1jsn921e443667ed',
                'x-rapidapi-host': 'indeed12.p.rapidapi.com'
            }
        };

        try {
            const response = await fetch(url, options);
            const result = await response.text();
            console.log(result);
        } catch (error) {
            console.error(error);
        }
    };

    useEffect(()=>{
        fetchCompanyJobs();
    }, []);

  return (
    <div>
        <SearchCompanies></SearchCompanies>
    </div>
  )
}

export default SearchCompaniesPage
